import { addSubcomponents } from '../../utils/addSubcomponents';
import { StyledBadge, StyledBadgeLabel } from './Badge.styles';
var Badge_ = StyledBadge;
var Label = StyledBadgeLabel;
Badge_.displayName = 'Badge';
Label.displayName = 'Badge.Label';
export var Badge = addSubcomponents({
    Label: Label,
}, Badge_);
export default Badge;
